import React from 'react'

const landingPage = () => {

    const headerStyle = {
        textColor: '#070EF7'
    }

    const buttonStyle = {
        backgroundColor: '#483D53',
        textColor: '#FFFFFF'
    }

    return (
        <div>
            <h1 style={headerStyle}>
                SnapCode
            </h1>
            <button style={buttonStyle}>
                Get Started!
            </button>
        </div>
    )
}

export default landingPage;
